import {useDispatch} from "react-redux";
import {deleteTodo, toggleTodo} from "../Action/TodoActions";

export default function DisplayTodo(props) {
	const dispatch = useDispatch();

	return (
		<li onClick={() => dispatch(toggleTodo(props.todo.id))}>{props.todo.task} -- {props.todo.completed ? 'fait' : 'a faire'}</li>
	)
}
